import data from "../json/painting.json";

import { Counter } from "./Counter";
import { Card } from "./Card";

export const App = () => {
  return (
    <div>
      <Counter />
      <Card
        url={data.url}
        title={data.title}
        authorName={data.author.tag}
        profileUrl={data.author.url}
      />
    </div>
  );
};
